import React from "react";
import TournamentForm from "../components/Form/form";

const Home = () => {
  return (
    <form onSubmit={tournamentForm.handleSubmit()}>
      <label>
        Tournament Name:
        <input type="text" name="name" />
      <label>
        Tournament Type:
        <input type="text" name="name" />
      </label>
        Number of Paricipants:
        <input type="text" name="name" />
      </label>
      <input type="submit" value="GENERATE" />
    </form>
  );
};

export default Home;
